import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import VideoRecognition from './Pages/VideoRecon';

function App() {
  return (
    <Router>
      <Routes>
        <Route path='/videorecon' element={<VideoRecognition />} />
        <Route path="/hello" element={<Api />} />
      </Routes>
    </Router>
  );
}

export default App;
